import React from 'react';
import './Solution.css';


class Solution extends React.Component {
   render() {
    return (
      <div>
        <svg width="400" height="110">
          <rect width="300" height="100" style="fill:rgb(0,0,255);stroke-width:3;stroke:rgb(0,0,0)" />
        </svg>
      </div>
      );
  }
}

export default Solution;
